import styled from "styled-components";

export const Container = styled.div`
  margin: 1% 0% 35% 35%;
  padding-left: 40px;
  padding-right: 40px;
  width: 30%;
  height: 40%;
  text-align: center;
  border: 2px solid #2072d7b3;
  background-color: white;
  border-radius: 10px;
`;
